function getPriceinUSD() public view returns (uint256 priceInUsdt) {
    // External contract addresses
    address usdtAddress              = 0xdAC17F958D2ee523a2206206994597C13D831ec7;
    address wethAddress              = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;

    // Uniswap-V2 pair addresses used for price discovery
    address usdtWethPair             = 0x0d4a11d5EEAAc28Ec3F61D100DAF4d40471f1852; // USDT / WETH
    address targetTokenWethPair      = 0x3ac4b2c0CbB85d309F1a7d0410E8E10594e5c928; // Target-Token / WETH

    // Address of the target token whose USD price we want
    address targetTokenAddress       = 0xe1223F2d494c37F83e1BdDa5015e990938F00d81;

    // -------------------------------------------------------------------------
    // Step-1: determine the price of 1 WETH in USDT
    // -------------------------------------------------------------------------
    uint256 usdtReserve  = IERC20(usdtAddress).balanceOf(usdtWethPair);
    uint256 wethReserve  = IERC20(wethAddress).balanceOf(usdtWethPair);

    require(wethReserve > 0, "SafeMath: division by zero");

    // Use 18-decimals precision for internal calculations
    uint256 ethPriceInUsdt = (usdtReserve * 1e18) / wethReserve;

    // -------------------------------------------------------------------------
    // Step-2: determine the price of the target token in WETH
    // -------------------------------------------------------------------------
    uint256 wethReserveInTargetPair     = IERC20(wethAddress).balanceOf(targetTokenWethPair);
    uint256 targetTokenReserveInPair    = IERC20(targetTokenAddress).balanceOf(targetTokenWethPair);

    require(targetTokenReserveInPair > 0, "SafeMath: division by zero");

    // -------------------------------------------------------------------------
    // Step-3: convert the target token price to USDT using the WETH-USDT price
    // -------------------------------------------------------------------------
    priceInUsdt = (ethPriceInUsdt * wethReserveInTargetPair) / targetTokenReserveInPair;
}

